import React from 'react'

export default function CreateSuperUser() {

    useEffect(() => {
        fetchData();
        const createSuperUser = () => {
            fetch("http://localhost:5000/createSuperUser", {
              method: "POST",
              headers: {
                "Content-Type": "application/json",
              },
              body: JSON.stringify(superUserFormData),
            })
              .then((response) => response.json())
              .then((data) => {
                if (data.message) {
                  // Super User created successfully, refresh the data
                  fetchData();
                } else {
                  console.error("Error creating Super User:", data.error);
                }
              })
              .catch((error) => {
                console.error("Error creating Super User:", error);
              });
          };}, []);

  return (
    <div>
        <form>
            <h3>Create Super User</h3>
            <div>
              <input
                type="text"
                placeholder="First Name"
                value={superUserFormData.fname}
                onChange={(e) =>
                  setSuperUserFormData({
                    ...superUserFormData,
                    fname: e.target.value,
                  })
                }
              />
            </div>
            <div>
              <input
                type="text"
                placeholder="Last Name"
                value={superUserFormData.lname}
                onChange={(e) =>
                  setSuperUserFormData({
                    ...superUserFormData,
                    lname: e.target.value,
                  })
                }
              />
            </div>
            <div>
              <input
                type="email"
                placeholder="Email"
                value={superUserFormData.email}
                onChange={(e) =>
                  setSuperUserFormData({
                    ...superUserFormData,
                    email: e.target.value,
                  })
                }
              />
            </div>
            <div>
              <input
                type="password"
                placeholder="Password"
                value={superUserFormData.password}
                onChange={(e) =>
                  setSuperUserFormData({
                    ...superUserFormData,
                    password: e.target.value,
                  })
                }
              />
            </div>
          </form>
    </div>
  )
}
